script: |
  super -f text -I q8103.spq | sort > q8103.out

inputs:
  - name: q8103.spq
    data: |
      SELECT + COUNT ( * ) + SUM ( - col1 ) AS col0 FROM tab0 (FORMAT parquet) WHERE + col1 * - - col2 + + col2 > col1 * col1 - 65 * col2;
  - name: tab0

outputs:
  - name: q8103.out
    data: |
      -100
